import React, {Component} from 'react';
import './App.css';

class App extends Component {
    // constructor() {
    //     super();
    //     this.state.show = false
    //     this.state.items = "test"
    // }

    componentDidMount() {
        this.setState({
            show: false
        })
    }

    test() {
        fetch("http://localhost:8080/shortestPath/maxDistance/C/C/30")
            .then(
                (result) => {
                    this.setState({
                        items: result,
                        show: true
                    });
                },
                (error) => {
                    this.setState({
                        error
                    });
                }
            )
    }

    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <h1>Welcome to ThoughtWorks Train Manage System!</h1>
                </header>
                <main>
                    <button onClick={this.test}>Test</button>
                    {this.state.show ? <p>{this.state.items}</p> : null}
                </main>
            </div>
        );
    }
}

export default App;
